import React from 'react'
import { Menu, Icon } from 'antd'

export default ({ children }) => {
  return (
    <div>
      <Menu>
        <Menu.Item key="mail">
          <Icon type="mail" />
          Navigation One
        </Menu.Item>
      </Menu>
      {children}
    </div>
  )
}
